using System.IO;
using ConcordiumNetSdk.Transactions;
using FluentAssertions;
using Xunit;

namespace ConcordiumNetSdk.UnitTests.Transactions;

public class DeployModulePayloadTests
{
    public byte[] Content { get; }

    public DeployModulePayloadTests()
    {
        var filePath = Path.Combine(Directory.GetCurrentDirectory(), @"Transactions/Files/a.wasm.v1");
        Content = File.ReadAllBytes(filePath);
    }

    [Fact]
    public void Create_when_valid_data_passed_should_create_correct_instance()
    {
        // Arrange

        // Act
        var deployModulePayload = DeployModulePayload.Create(Content);

        // Assert
        deployModulePayload.Content.Should().BeEquivalentTo(Content);
    }

    [Fact]
    public void SerializeToBytes_should_return_correct_data()
    {
        // Arrange
        var deployModulePayload = DeployModulePayload.Create(Content);
        var expectedSerializedDeployModulePayload = GetExpectedSerializedDeployModulePayload();

        // Act
        var serializedDeployModulePayload = deployModulePayload.SerializeToBytes();

        // Assert
        serializedDeployModulePayload.Should().BeEquivalentTo(expectedSerializedDeployModulePayload);
    }

    [Fact]
    public void GetBaseEnergyCost_should_return_correct_data()
    {
        // Arrange
        var deployModulePayload = DeployModulePayload.Create(Content);
        var expectedBaseEnergyCost = 1264ul;

        // Act
        var baseEnergyCost = deployModulePayload.GetBaseEnergyCost();

        // Assert
        baseEnergyCost.Should().Be(expectedBaseEnergyCost);
    }

